import React from 'react';

const styles = {
  duoImage: {width: '30%'}
}

const imageHandler = (e) => { console.log(e.target.src == 'boxA.gif'); e.target.src = (e.target.src == 'boxA.gif' ? 'boxB.gif' : 'boxA.gif');}

const GeneralPractice18 = () => (
  <div>
    <img src='boxA.gif' onClick={imageHandler} style={styles.duoImage}></img>
    <img src='boxB.gif' onClick={imageHandler} style={styles.duoImage}></img>
  </div>
);

export default GeneralPractice18;
